import React from "react";

const Movie = ({ movie, onDelete }) => {
  console.log(movie);
  const {
    title,
    genre,
    numberInStock: stock,
    dailyRentalRate: rate,
    _id
  } = movie;
  return (
    <tr>
      <th scope="row">{title}</th>
      <td>{genre.name}</td>
      <td>{stock}</td>
      <td>{rate}</td>
      <td>
        <button
          onClick={() => onDelete(_id)}
          className="btn btn-danger btn-sm m-2">
          Delete
        </button>
      </td>
    </tr>
  );
};

export default Movie;

